AccessibilityText":"Buy merchandise from Pumpkin Productivity","fromVendorText":"From Pumpkin Productivity","additionalFeesText":"","showOpenInNewIcon":true}},{"merchandiseItemRenderer":{"title":"Stress Tracker","description":"This weekly stress tracker, in a calming green, will help you to reflect on your stress levels and take measures to reduce it, meaning that you can be the happiest and most productive version of yourself. Stress can massively inhibit how much we enjoy our study sessions (and just tasks in general), by living more mindfully, we can begin to enjoy being productive and thence feel more fulfilled in our day to day lives. The planner is focused around the Tracking Table at the top where you will rate your stress each day of the working week on a scale of 1-5. Next to this, you can then reflect on possible reasons for increased stress levels that day. The following questions and boxes will help you to make sense of these ratings and make you aware of how you can resolve any issues raised. There is, for example, a place for you to jot down anything you did which minimised stress, and another where you can consider goals for the week ahead. The pdf Pumpkin Papers are for those seasoned digital note takers who prefer to do everything on a screen. It can be super useful to have downloaded on your tablet or phone. Write out your plan in the morning, add to it during the day and then clear the file in the evening -- ready for tomorrow. Alternately, you can go old school: print it yourself at home and use as you would any other physical planner. The pdf Pumpkin Papers are such a handy study companion to have :) This is a digital download, not a physical product.","thumbnail":{"thumbnails":[{"url":"https://encrypted-tbn2.gstatic.com/shopping?q=tbn:ANd9GcSGSzJNZkloDRANf7yVvrGTT85ja7cYzDSjH_frBa84JXfq6PXy3IGXMdyLZOJFiAKZY0i9AyNw","width":128,"height":128},{"url":"https://encrypted-tbn2.gstatic.com/shopping?q=tbn:ANd9GcTy_EOggERbYRw2qHhPMfB3wrzx-qQ0fibrLsTS68T
